import React from 'react';
import './loading.css'; // Your CSS for styling the loading screen
import SearchIcon from '../Assets/Icons/SearchIcon.png'
import { Link  } from 'react-router-dom';

const linkStyles = {
  
    color: 'inherit', // Inherit the color from the parent
  };

const NotFound = () => {
  return (
    <div className="loading-screen">
        <img src = {SearchIcon} style={{ width: '250px', height: '250px' }}/>
        <div>
            <div>
                <h1 className="caption  type-caption ">Page not found!</h1>
                <Link to = {"/"} style={linkStyles} className="caption  type-caption ">Return home</Link>
            </div>
        </div>
      
    </div>
  );
};

export default NotFound;
